import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';

/*const element = React.createElement('ol', null, 
  tasks.map((task, index) =>  React.createElement('li', {key: index}, task))
);
const jsxElement = 
    <div>
      <h3>React (Create)Elements Render</h3>
        {element}
      <h3>JSX Elements Render</h3>
    </div>;*/

class Title extends Component{
  render(){
    return(
      <h3>{this.props.title}</h3>
    );
  }
}
class List extends Component{
  render(){
    return(<ol>
      {
        this.props.tasks.map((task, index) =>  <li key = {index}>{task}</li>)
      }
    </ol>);
  }
}
class Main extends Component{
  render(){
    return(
      <div>
        <Title title = {'React (Create)Elements Render'} />
        <List tasks = {['Study', 'Go for a run', 'Have lunch']} />
        <Title title = {'JSX Elements Render'} />
        <List tasks = {['Rest', 'Talk to wife', 'Talk to family', 'MMA Training', 'Consume shake', 'Cook dinner']} />
      </div>
    );
  }
}
ReactDOM.render(
 <Main />,
  document.getElementById('root')
);

